    public String minWindow(String s, String t) {
        if (s.length() < t.length()) {
                return "";
        }


        long startTime = System.currentTimeMillis();    //获取开始时间


        char [] cs = s.toCharArray();
        char [] ct = t.toCharArray();

        Map<Character,Integer> map = new HashMap<Character,Integer>();

        for (int i=0; i<ct.length;++i){
            int number = 1;
            Integer x = map.get(ct[i]);
            if (x != null)
                number += x;
            map.put(ct[i],number);
        }


        Map<Character,RingIntBuffer> map2 = new HashMap<>();


        for (Map.Entry<Character,Integer> entry:
             map.entrySet()) {
            map2.put(entry.getKey(),new RingIntBuffer(entry.getValue()));
        }

        Map<Integer,String> pathMap = new HashMap<>();
        int curMinPath = Integer.MAX_VALUE;


        long endTime = System.currentTimeMillis();    //获取结束时间

        System.out.println("程序运行时间：" + (endTime - startTime) + "ms");    //输出程序运行时间

        //暴力解法
        for (int i=0;i<cs.length;++i){
            boolean continue_flag = false;
            RingIntBuffer rbi2 = map2.get(cs[i]);
            if (rbi2 == null)
                continue;

            if (rbi2.add(i) == true){
                //求最长路径
                int min = Integer.MAX_VALUE;
                int max = Integer.MIN_VALUE;
                if (ct.length > 20){
                    for (int j=0;j<'z'-'a';++j){
                        RingIntBuffer rbi = map2.get('a'+j);
                        if (rbi == null) continue;
                        if (rbi.flag == false) {
                            continue_flag = true;
                            break;
                        }
                        max = Math.max(max, rbi.buffer[rbi.tail]);
                        min = Math.min(min, rbi.buffer[rbi.head]);
                    }
                }else{
                    for (int j=0;j<ct.length;++j){
                        RingIntBuffer rbi = map2.get(ct[j]);
                        if (rbi.flag == false) {
                            continue_flag = true;
                            break;
                        }
                        max = Math.max(max, rbi.buffer[rbi.tail]);
                        min = Math.min(min, rbi.buffer[rbi.head]);
                    }
                }


                if (continue_flag == true){
                    continue;
                }

                if (min < -1 || max == -1)
                    continue;
                if (min <0 || max < 0)
                    continue;
                if (min == Integer.MAX_VALUE)
                    continue;;

                int path = max - min + 1;
                if (path < curMinPath){
                    pathMap.put(path, s.substring(min,max+1));
                    curMinPath = path;
                }
            }


        }

        if (pathMap.isEmpty())
            return "";

        int key_min = Integer.MAX_VALUE;

        for (Map.Entry<Integer,String> entry:pathMap.entrySet()
             ) {
            key_min = Math.min(key_min,entry.getKey());
            
        }


        return pathMap.get(key_min);
        


    }

    public static void main(String[] args) {
        s076 s076 = new s076();


        System.out.println(s076.minWindow("ADOBECODEBANC","ABC"));
//
        System.out.println(s076.minWindow("AA","AA"));


        long startTime = System.currentTimeMillis();    //获取开始时间

        System.out.println(s076.minWindow("",
        ""));

        long endTime = System.currentTimeMillis();    //获取结束时间

        System.out.println("程序运行时间：" + (endTime - startTime) + "ms");    //输出程序运行时间



    }

